const CustomImage = (props) => {
    let [ID, setID] = useState()
    let [ftype, setFtype] = useState()
    let [name, setName] = useState()
    let [path, setPath] = useState()

    useEffect(() => {
        setID(props.item.ID)
        setFtype(props.item.Ftype)
        setName(props.item.Name)
        setPath(props.item.Path)
    });

    if (ftype == 1) {
        return (
            <div
                style={{
                    width: '180px',
                    height: '180px',
                    
                }}
            >
                
                <div
                    style={{
                        width: '180px',
                        height: '180px',
                        
                        
                    }}
                    onClick={() => { 
                        if (ftype === 0) {
                            props.changeImage(ID, path) 
                        } else {
                            props.changeFolder(ID)
                        }
                    }}
                >
                    <div
                        style={{
                            position: 'relative'
                        }}
                    >
                        <img
                            style={{
                                width: '180px',
                                height: '180px',
                                borderRadius: '5px',
                            }}
                            src="/admin/img/folder.png"
                        />
                        <div
                            style={{
                                position: 'absolute',
                                top: '0px'
                            }}
                        >{name}</div>
                    </div>
                </div>
            </div>
        )
    }

    console.log(props)
    let src="http://localhost:9012/dynamic/180x120" + props.item.Path

    return (
        <div
            style={{
                width: '180px',
                height: '180px',
                borderRadius: '5px'
            }}
        >
            <img
                style={{
                    width: '180px',
                    height: '180px',
                    borderRadius: '5px'
                }}
                onClick={() => { 
                    if (ftype === 0) {
                        props.changeImage(ID, path) 
                    } else {
                        props.changeFolder(ID)
                    }
                }}
                src={src}
                onError={({ currentTarget }) => {
                    currentTarget.onerror = null; // prevents looping
                    currentTarget.src="data:image/png;base64,";
                }}
                onerror="this.src='data:image/png;base64,'"
            />
        </div>
    )
    // src="data:image/png;base64," 
    // https://tech-max.ru/dynamic/180x120/photo1698340074.jpeg
}

const ImageList = (props) => {
    return (
        <>
            {props.items.map((item, i) => { 
                return (<CustomImage 
                    changeFolder={props.changeFolder} 
                    changeImage={props.changeImage} 
                    item={item} 
                />) 
            })}
        </>
    )
}

